import {Link} from 'react-router-dom';

function Assignments () {
    return ( 
    <div className="assignments">
        <br/>
    <div style={{
        background: 'wheat',
         border: `6px solid yellow` ,
         height: '30rem',
         width: '40rem',
         paddingTop: '0rem',
         color: 'orange'
         }}>
             Assignments<br/>
            <Link to="/schedule"> Schedule </Link>
             </div>
    </div>
        );
}

export default Assignments;
